textOriginal:
Po que o Bozo será derrotado??
- O maior inimigo do Bozo é ele próprio...quando abre a bocarra;
- Sempre acerta o próprio pé;
- Bozo se desacreditou totalmente;
- Bozo não se preocupa em mentir;
- Bozo compra apoio político e do povo;
- Bozo não é  carismático;
- Bozo é forte em ódio e fraco em propostas;
- Campanha do Bozo é forte em fake news...
